import React from "react";

const UserProfile = ({ user }) => {
  return (
    <div>
      <h2 className="greeting">Witaj, {user.firstName}!</h2>
      <p className="firstnamepf">Imię: {user.firstName}</p>
      <p className="lastnamepf">Nazwisko: {user.lastName}</p>
      <p className="bday">Data urodzenia: {user.birthDate}</p>
    </div>
  );
};

export default UserProfile;
